const ExButton = ({ value, onPress, innerRef }) => {
  return (
    <Pressable
      ref={innerRef}
      onPress={onPress}
      style={{
        width: 80,
        height: 45,
        borderRadius: 5,
        paddingHorizontal: 10,
        borderColor: "#767676",
        borderWidth: 1,
        alignItems: "center",
        justifyContent: "center",
      }}>
      <Text
        style={{
          color: "#767676",
          fontSize: 14,
        }}>
        {value ? value : "Gender"}
      </Text>
    </Pressable>
  );
};
